import React from 'react'
import miniusers from '.../assets/icons/miniusers.svg'
import charttree from '.../assets/icons/fi-sr-chart-tree.svg'
const CourseCard = ({active,title,subcontent}) => {
  return (
    // active true means white card 
    <div className={`${active?" bg-white text-black":" bg-richblack-600 text-white"} h-[300px] w-[32%]
    flex flex-col justify-between`}>
      
      {/* title and content */}
      <div>
        <div>{title}</div>
        <div>{subcontent}</div>
      </div>

      {/* footer of card */}
      <div className='flex justify-between'>
        {/* beginner */}
        <div>
            <img src={miniusers}></img>
            Beginner
        </div>
        {/* lessons */}
        <div>
            <img src={charttree}></img>
            6 Lessons
        </div>
      </div>
    </div>
  )
}

export default CourseCard
